import React from 'react';
import styeld from 'styled-components';

const Button=styeld.img`
  width:24px;
  height:24px;
  float:right;
  margin-top:20px;
  margin-right: 100px;
`
function Main() {
  return (
    <Button src='images/newPost/newPost_normal.png'></Button>
  );
}


export default Main;
